import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <div style={{ top: "30%", position: 'absolute', width: "100%" }}>
      <div style={{fontSize: 80, fontStyle: "san serif"}}>
        <span style={{ color: 'blue' }}>L</span>
        <span style={{ color: 'red' }}>o</span>
        <span style={{ color: 'yellow' }}>o</span>
        <span style={{ color: 'blue' }}>g</span>
        <span style={{ color: 'lightgreen' }}>l</span>
        <span style={{ color: 'red' }}>e</span>
      </div>
        <input style={{ width: "50%", left: "25%", maxWidth: 600, minWidth: 400, height: 30, borderRadius: 20, 
                boxShadow: '0px px 10px 10px #00000010', padding: 10, paddingLeft: 20, paddingRight: 20,
                fontSize: 20, border: "1px solid #cecece"
              }} type="text" placeholder="Search..." />
        </div>
    </div>
  );
}

export default App;
